],\"defaultAudioTrackIndex\":0}},\"videoDetails\":{\"videoId\":\"xbagFzcyNiM\",\"title\":\"I Am Not A Monster: Schizophrenia | Cecilia McGough | TEDxPSU\",\"lengthSeconds\":\"881\",\"keywords\":[\"TEDxTalks\",\"English\",\"United States\",\"Health\",\"Mental health\",\"Students\"],\"channelId\":\"UCsT0YIqwnpJCM-mx7-gSA4Q\",\"isOwnerViewing\":false,\"shortDescription\":\"Cecilia McGough puts a face to schizophrenia and helps empower college students through the upcoming non-profit Students With Schizophrenia.\\r\\nStudents With Schizophrenia: http:\/\/sites.psu.edu\/studentswithschizophrenia\/ \\r\\nI Am Not A Monster: SCHIZOPHRENIA: http:\/\/sites.psu.edu\/ceciliamcgough\/\\n\\nCecilia McGough is an astronomer, activist, and writer as a Penn State Schreyer Honors College scholar pursuing a major in Astronomy \\u0026 Astrophysics. Cecilia is the founder and current president of the Penn State Pulsar Search Collaboratory. She has been participating in pulsar research continuously since December of 2009, co-discovering pulsar J1930-1852 with the widest orbit ever observed around another neutron star, competing in the International Space Olympics held in Russia, and co-authoring her research in the Astrophysics Journal. Cecilia is a mental health activist in fighting against the negative stigma towards mental illness. She is the founder and chief executive officer (CEO) of the soon to launch non-profit Students With Schizophrenia which is the only non-profit in the United States focused on empowering college students with schizophrenia.\\n\\nThis talk was given at a TEDx event using the TED conference format but independently organized by a local community. Learn more at http:\/\/ted.com\/tedx\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/xbagFzcyNiM\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLDNuxkIYkI-IdXkS1CaU45SqL99ug\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.yti oming non-profit Students With Schizophrenia.\r\nStudents With Schizophrenia: http://sites.psu.edu/studentswithschizophrenia/ \r\nI Am Not A Monster: SCHIZOPHRENIA: http://sites.psu.edu/ceciliamcgough/\n\nCecilia McGough is an astronomer, activist, and writer as a Penn State Schreyer Honors College scholar pursuing a major in Astronomy \u0026 Astrophysics. Cecilia is the founder and current president of the Penn State Pulsar Search Collaboratory. She has been participating in pulsar research continuously since December of 2009, co-discovering pulsar J1930-1852 with the widest orbit ever observed around another neutron star, competing in the International Space Olympics held in Russia, and co-authoring her research in the Astrophysics Journal. Cecilia is a mental health activist in fighting against the negative stigma towards mental illness. She is the founder and chief executive officer (CEO) of the soon to launch non-profit Students With Schizophrenia which is the only non-profit in the United States focused on empowering college students with schizophrenia.\n\nThis talk was given at a TEDx event using the TED conference format but independently organized by a local community. Learn more at http://ted.com/tedx","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/xbagFzcyNiM/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLDNuxkIYkI-IdXkS1CaU45SqL99ug","width":168,"height":94},{"url":"https://i.ytimg.com/vi/xbagFzcyNiM/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLA5rObjw6d_WKUEvBkLL7ExypRJZw","width":196,"height":110},{"url":"https://i.ytimg.com/vi/xbagFzcyNiM/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLDjRcUuHQn2Uf33HTC9zEheEk0rRA","width":246,"height":138},{"url":"https://i.ytimg.com/vi/xbagFzcyNiM/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLAO2Cwa0Q_YLm9hgEoAS1mCURQxl
